const storage = () => {
    const arr = [];

    if (localStorage.length > 0) {
        for (let i = 0; i < localStorage.length; i++) {
            if (localStorage.key(i) != "loglevel:webpack-dev-server" && localStorage.key(i) != '') {
                arr.push(JSON.parse(localStorage.getItem(localStorage.key(i))));
            }
        }
    }

    return arr;
};

const state = {
    todoItems: storage(),
}

const mutataion = {
    todoItems: storage(),
}
